import React from 'react';
import Nav from './Navigation';
import {Container} from 'reactstrap';
import AmazonAds from './AmazonAds';

const MainPage = () => {
    return(
        <Container fluid>
            <Nav />
            <p>Home Page</p>

            <AmazonAds />
        </Container>
    );
};

export default MainPage;
